import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

const PredictionResult = ({ prediction }) => {
  if (!prediction) return null;

  const recommendations = Array.isArray(prediction.recommendations) 
    ? prediction.recommendations 
    : [prediction.recommendations];

  const getProbabilityClass = (confidence) => {
    if (confidence < 60) return 'probability-low-single';
    if (confidence < 80) return 'probability-medium-single';
    return 'probability-high-single';
  };

  const confidenceValue = Array.isArray(prediction.confidence) 
    ? prediction.confidence[0] 
    : prediction.confidence;

  const confidence = Math.round(confidenceValue * 100);
  const probabilityClass = getProbabilityClass(confidence);

  return (
    <Box sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 3, borderRadius: 2 }}>
        <Typography variant="h5" gutterBottom>
          Analyse-Ergebnisse
        </Typography>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6" color="primary" gutterBottom>
            Wechselwahrscheinlichkeit
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
            <Typography variant="h3" sx={{ color: '#001B41', mr: 2 }}>
              {confidence}%
            </Typography>
            <Box sx={{ flex: 1, position: 'relative', height: '16px', mr: 2 }}>
              <Box
                sx={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  height: '100%',
                  width: '100%',
                  bgcolor: '#f0f0f0',
                  borderRadius: '6px',
                  overflow: 'hidden',
                }}
              />
              <Box
                sx={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  height: '100%',
                  width: `${confidence}%`,
                  bgcolor: probabilityClass === 'probability-low-single' ? '#dc3545' :
                          probabilityClass === 'probability-medium-single' ? '#ffc107' : '#28a745',
                  borderRadius: '6px',
                  transition: 'width 0.3s ease',
                }}
              />
            </Box>
          </Box>
        </Box>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6" color="primary" gutterBottom>
            Empfehlungen
          </Typography>
          <Box component="ul" sx={{ listStyle: 'none', p: 0, m: 0 }}>
            {recommendations && recommendations.length > 0 ? (
              recommendations.map((rec, index) => (
                <Box
                  component="li"
                  key={index}
                  sx={{
                    p: '12px 15px',
                    bgcolor: '#f5f5f5',
                    borderRadius: '8px',
                    mb: 1,
                    fontSize: '0.95rem',
                    color: '#666',
                    '&:last-child': { mb: 0 }
                  }}
                >
                  {rec}
                </Box>
              ))
            ) : (
              <Box
                component="li"
                sx={{
                  p: '12px 15px',
                  bgcolor: '#f5f5f5',
                  borderRadius: '8px',
                  fontSize: '0.95rem',
                  color: '#666'
                }}
              >
                Keine Empfehlungen verfügbar
              </Box>
            )}
          </Box>
        </Box>
      </Paper>

      {/* Vorhersage-Erklärung separat und in eigenen Boxen */}
      {prediction.explanations && prediction.explanations.length > 0 && (
        <Box sx={{ mt: 4 }}>
          <Typography variant="h6" color="primary" gutterBottom sx={{ mb: 2, fontSize: '1.2rem' }}>
            Vorhersage-Erklärung
          </Typography>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
            {prediction.explanations.map((feature, idx) => (
              <Paper
                key={idx}
                elevation={2}
                sx={{
                  p: 2,
                  borderRadius: 2,
                  bgcolor: '#f8fafc',
                  borderLeft: `6px solid ${
                    feature.impact_percentage > 30 ? '#28a745' :
                    feature.impact_percentage > 15 ? '#ffc107' : '#dc3545'
                  }`
                }}
              >
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Typography variant="subtitle1" sx={{ fontWeight: 700, mr: 1 }}>
                    {idx + 1}. {feature.feature}
                  </Typography>
                  <Typography variant="body2" sx={{ color: '#666', fontWeight: 500 }}>
                    ({feature.impact_percentage.toFixed(1)}%)
                  </Typography>
                </Box>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Box sx={{
                    width: `${feature.impact_percentage}%`,
                    maxWidth: 300,
                    height: 10,
                    bgcolor: feature.impact_percentage > 30 ? '#28a745' :
                            feature.impact_percentage > 15 ? '#ffc107' : '#dc3545',
                    borderRadius: 2,
                    mr: 2
                  }} />
                  <Typography variant="body2" sx={{ minWidth: 50 }}>
                    {feature.impact_percentage.toFixed(1)}%
                  </Typography>
                </Box>
                <Typography variant="body2" color="text.secondary">
                  {feature.description}
                </Typography>
              </Paper>
            ))}
          </Box>
        </Box>
      )}
    </Box>
  );
};

export default PredictionResult;
